import Head from "next/head";
import React from "react";

const Meta = () => (
  <Head>
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <meta charSet="utf-8" />
    <title>Formality!</title>
  </Head>
);

export default Meta;
